import React from "react"

function Food({ name, price }){ // same with Food({ fav })
  return(
    <div>I love { name } which is { price }</div>
  )
}

const foodILike = [
  {id: 1, name: "kimchi", price: "$4"},
  {id: 2, name: "pizza", price: "$11"},
  {id: 3, name: "ramen", price: "$15"},
  {id: 4, name: "burger", price: "$9"},
  {id: 5, name: "icecream", price: "$2"}
]

function renderFood(dish){
  console.log(dish);
  return <Food key={dish.id} name={dish.name} price={dish.price}/>
}
function App() {
  return (
    <div className="App">
      {foodILike.map(renderFood)}
    </div>
  );
}

export default App;
